caption:
Demorei 23 anos para perceber que: 
- Só eu posso mudar o meu mundo; 
- Só eu me amarei incondicionalmente; 
- Só eu posso mudar minha história; 
- Que a felicidade vem da alma e o que você transmite você recebe; 
- Que quem confia no homem, está destinado à falhar; 
- O que eu quero eu posso, eu consigo, basta realmente querer; 
- Que amar a si próprio não é errado, é necessário! 
- Quem merece 100% da minha atenção sou eu mesmo. 
- Que haverão pessoas boas e ruins, e que o mundo é assim. Só aceita! 
- Que ninguém pensa como eu e que eu não devo me decepcionar por isso. 
- Que ninguém muda por ninguém; 
- Que a independência é uma faca de dois gumes; 
- Que o estudo transforma; 
- Que devo ser eu mesmo, aceite quem quiser. 

Dentre outras coisas, percebi que sou capaz!  Que talvez, só talvez, eu não seja tão ruim assim. 

Agradeço a Deus por ser o homem que sou e ter o que tenho, tudo depende de mim e eu me amo muito por quem eu me tornei e estou me tornando a cada dia. Mudar é necessário! 

No fim, aprendi a me amar!
